const generateCollisionsMap = (): number[][] => {
    const collisionsMap: number[][] = [];
    
    for (let i = 0; i < collisionsArray.length; i += 112) {
        collisionsMap.push(collisionsArray.slice(i, 112 + i));
    }

    return collisionsMap;
};

export interface BoundaryType extends Coords , Size {}

const collisionsMap: number[][] = generateCollisionsMap();

const calculateBoundaries = (): BoundaryType[] => {
    const boundariesList: BoundaryType[] = [];
    collisionsMap.forEach((row, i) => {
        row.forEach((symbol, j ) => {
            if(symbol === 1025) {
                boundariesList.push({
                    x: j * 48, // 12 * 400% zoom
                    y: i * 48,
                    width: 48,
                    height: 48, 
                });
            }
        });
    });
    return boundariesList;
};

export const boundaries: BoundaryType[] = calculateBoundaries(); 

// player is supposed to always have anchor 0.5
export const verifyBoundariesCollisions = (player: BoundaryType, mapOffset: Coords): boolean => {
    let collisionDetected = false;

    boundaries.forEach((boundary) => {
        if (
            player.x - (player.width * 0.5) < boundary.x + boundary.width + mapOffset.x &&
        player.x + (player.width * 0.5) > boundary.x + mapOffset.x &&
        player.y - (player.height * 0.5) < boundary.y + boundary.height + mapOffset.y &&
        player.y + (player.height * 0.5) > boundary.y + mapOffset.y
        ) {
            collisionDetected = true;
        }
    });

    return collisionDetected;
};
